  Code = "class Solution:\n    def numDifferentIntegers(self, word: str) -> int:\n        enc = set()\n        cur = []\n        for char in itertools.chain(word, \"a\"):\n            if char.isalpha():\n                if cur:\n                    count = 0\n                    num = 0\n                    while cur:\n                        num += cur.pop() * (10 ** count)\n                        count += 1\n                    enc.add(num)\n            else:\n                cur.append(int(char))\n        return len(enc)\n        \n            "
